import Header from './Header';
import UHeader from './UHeader';
import Footer from './Footer';

const Layout = ({ children }) => {
    return (
        <div>
    <React.Fragment>
            <UHeader />
            <Header />
            {children}

        </React.Fragment>
        <Footer />

        </div>

    );
};

export default Layout;
